import { Fragment } from "react";

const createLinearGradient = (id, stops) => (
  <linearGradient id={id} x1="50%" y1="0%" x2="50%" y2="100%">
    {stops.map(([offset, color], index) => (
      <stop key={index} offset={`${offset}%`} stopColor={color} />
    ))}
  </linearGradient>
);

